function getcenter(name)
    local count = 0
    local vec
    if string.find(game:GetService("Workspace")["_WorldOrigin"].EnemySpawns:GetChildren()[1].Name, "Lv.") then
        for i, v in pairs(game:GetService("Workspace")["_WorldOrigin"].EnemySpawns:GetChildren()) do
            if v.Name == name  then  
                if vec == nil then
                    vec = v.Position
                    count = count + 1
                else
                    vec = vec + v.Position
                    count = count + 1
                end
            end
        end
        for i, v in pairs(getnilinstances()) do
            if v:IsA("Part") and v.Name == name  then  
                if vec == nil then
                    vec = v.Position
                    count = count + 1
                else
                    vec = vec + v.Position
                    count = count + 1
                end
            end
        end
    else
        for i, v in pairs(game:GetService("Workspace")["_WorldOrigin"].EnemySpawns:GetChildren()) do 
            if  v.Name == tostring(name:gsub(" %pLv. %d+%p", "")) then
                if vec == nil then
                    vec = v.Position
                    count = count + 1
                else
                    vec = vec + v.Position
                    count = count + 1
                end
            end
        end
        for i, v in pairs(getnilinstances()) do 
            if v:IsA("Part") and  v.Name == tostring(name:gsub(" %pLv. %d+%p", "")) then
                if vec == nil then
                    vec = v.Position
                    count = count + 1
                else
                    vec = vec + v.Position
                    count = count + 1
                end
            end
        end
    end
    vec = vec / count
    return CFrame.new(vec)
end
