                    return "Swamp" 
                elseif not SoulGuitarCheck.Gravestones then 
                    return "Grave Stone"
                elseif not SoulGuitarCheck.Ghost then 
                    return "Ghost"
                elseif not SoulGuitarCheck.Trophies then 
                    return "Trophie"
