            for i, v in pairs(Quest) do
                for i1, v1 in pairs(v) do
                    local lvlreq = v1.LevelReq
                    for i2, v2 in pairs(v1.Task) do
                        if lvlcus >= lvlreq and lvlreq >= min and v1.Task[i2] > 1 and not table.find(UselessQuest, tostring(i)) then
                            min = lvlreq
